[ntargets, tmp] = size(state_in);

Rij = zeros(ntargets, ntargets);
r_de118  = zeros(ntargets, 3);
v_de118  = zeros(ntargets, 3);
a_newton = zeros(ntargets, 3);
acc_out  = zeros(ntargets, 3);
% Speed of light (au/d).
c = 173.144632720536344565;
c2 = c * c;

M = zeros(ntargets, ntargets);
M2 = zeros(ntargets, ntargets);
M3 = zeros(ntargets, ntargets);
M4 = zeros(ntargets, ntargets);

% Extract OSVs from state data.
for ind_target = 1:ntargets
    v_target_de118 = state_in(ind_target, [1, 3, 5]);
    r_target_de118 = state_in(ind_target, [2, 4, 6]);

    r_de118(ind_target, :) = r_target_de118;
    v_de118(ind_target, :) = v_target_de118;
end

for ind_target = 1:ntargets
    for ind_source = 1:ntargets
        Rij(ind_source, ind_target) = norm(r_de118(ind_target, :) - r_de118(ind_source, :));
    end
end

Rij3 = Rij.^3;

for ind_target = 1:ntargets
    for ind_source = 1:ntargets
        if ind_source == ind_target
            continue;
        end
        r_target_source = r_de118(ind_source, :) - r_de118(ind_target, :);
        acc_newton = (mu_DE118(ind_source) / Rij3(ind_source, ind_target)) ...
                   * r_target_source;

        a_newton(ind_target, :) = a_newton(ind_target, :) + acc_newton;
    end
    %disp(a_newton(ind_target, :))
end

for ind_target = 1:ntargets
    acc_target = zeros(1, 3);
    r_target = r_de118(ind_target, :);
    v_target = v_de118(ind_target, :);

    for ind_source = 1:ntargets
        if ind_source == ind_target
            continue;
        end
        r_source = r_de118(ind_source, :);
        v_source = v_de118(ind_source, :);

        r_target_source = r_source - r_target;
        v_target_source = v_source - v_target;

        % Newtonian part of the acceleration.
        acc_newton = (mu_DE118(ind_source) / Rij3(ind_source, ind_target)) ...
                   * r_target_source;

        newton_mult = 0;
        for ind_target2 = 1:ntargets
            if ind_target ~= ind_target2
                newton_mult = newton_mult ...
                            - (4 / c2) * mu_DE118(ind_target2) / Rij(ind_target, ind_target2);
            end

            if ind_source ~= ind_target2
                newton_mult = newton_mult ...
                            - (1 / c2) * mu_DE118(ind_target2) / Rij(ind_source, ind_target2);
            end
        end

        % For verification.
        M(ind_target, ind_source) = newton_mult +     norm(v_de118(ind_target, :))^2 / c2 ...
                    + 2 * norm(v_de118(ind_source, :))^2 / c2 - (4/c2) * dot(v_de118(ind_target, :), v_de118(ind_source, :)) ...
                    - (1.5/c2) * (dot(r_target_source, v_de118(ind_source, :)) / Rij(ind_source, ind_target))^2 ...
                    + (0.5/c2) * dot(r_target_source, a_newton(ind_source, :));
        

        %acc_target = acc_target + newton_mult * acc_newton;

        newton_mult = newton_mult ...
                    +     norm(v_de118(ind_target, :))^2 / c2 ...
                    + 2 * norm(v_de118(ind_source, :))^2 / c2 ...
                    - (4/c2) * dot(v_de118(ind_target, :), v_de118(ind_source, :)) ...
                    - (1.5/c2) * (dot(r_target_source, v_de118(ind_source, :)) / Rij(ind_source, ind_target))^2 ...
                    + (0.5/c2) * dot(r_target_source, a_newton(ind_source, :));
        M(ind_target, ind_source) = newton_mult;
        %M3(ind_target, ind_source) = newton_mult * acc_newton(1);

        %M(ind_target, ind_source) = newton_mult - 1;

        if ind_source ~= ind_target
            M2(ind_target, ind_source) = (newton_mult) * r_target_source(1) * mu_DE118(ind_source) / Rij3(ind_target, ind_source);

            %M3(ind_target, ind_source) = (1/c2) * mu_DE118(ind_source) / Rij3(ind_source, ind_target) ...
                      % * dot(r_target_source, 4 * v_target - 3 * v_source) * v_target_source(1);
            acc_target = acc_target ...
                       + newton_mult * acc_newton ...
                       + (1/c2) * mu_DE118(ind_source) / Rij3(ind_source, ind_target) ...
                       * dot(r_target_source, 4 * v_target - 3 * v_source) * v_target_source ...
                       + (3.5/c2) * mu_DE118(ind_source) * a_newton(ind_source, :) ...
                       / Rij(ind_source, ind_target);
            M3(ind_target, ind_source) = newton_mult * acc_newton(1) + (1/c2) * mu_DE118(ind_source) / Rij3(ind_source, ind_target) ...
                       * dot(r_target_source, 4 * v_target - 3 * v_source) * v_target_source(1) ...
                       + (3.5/c2) * mu_DE118(ind_source) * a_newton(ind_source, 1) ...
                       / Rij(ind_source, ind_target);
            M4(ind_target, ind_source) = acc_target(1);
        end
    end
    acc_out(ind_target, :) = acc_target;
    %disp([acc_newton, acc_target]);
end

rel_error = mean(mean(abs(acc_out(1:11, :) - acc_ref(1:11, 1:3)) ./ abs(acc_out(1:11, :))))